@unique
class States(Enum):
    """
    Define alignment mode.
    """
    POSE = 'pose'
    LANDMARKS = 'landmarks'
    ALL = 'all'


@unique
class Measures(Enum):
    """
    Estimate normalized error for each labelled landmark.
    """
    PUPILS = 'pupils'
    CORNERS = 'corners'
    HEIGHT = 'height'
    SRAREA = 'srarea'
    DIAGONAL = 'diagonal'


def parse_file(input_file):
    """
    Parse file to extract results.
    """
    results = {}
    num_objs = 0
    with open(input_file) as ifs:
        lines = ifs.readlines()
        for i in tqdm(range(len(lines)), file=sys.stdout):
            line = lines[i].strip()  # remove last newline
            parts = line.split(';')
            if int(parts.pop(0)) != 3:
                continue
            filename, ext = os.path.splitext(parts.pop(0))
            tile = np.array(parts.pop(0)[1:-1].split(',')).astype(int)
            keyname = filename + '_' + '_'.join([str(val) for val in tile]) + ext
            results.setdefault(keyname, {})
            num_annotations = int(parts.pop(0))
            num_predictions = int(parts.pop(0))
            # print(keyname, num_annotations, num_predictions)
            num_data = dict({'annotation': num_annotations, 'prediction': num_predictions})
            for key in num_data:
                for j in range(num_data[key]):
                    ident = parts.pop(0)
                    bbox = np.array(parts.pop(0)[1:-1].split(',')).astype(float)
                    pose = Rotation.from_matrix(np.array(json.loads(parts.pop(0)))).as_matrix()
                    num_landmarks = int(parts.pop(0))
                    landmarks = dict()
                    for idx in range(num_landmarks):
                        label = int(parts.pop(0))
                        pt_x = float(parts.pop(0))
                        pt_y = float(parts.pop(0))
                        visible = str(parts.pop(0)) == 'True'
                        confidence = float(parts.pop(0))
                        landmarks[label] = [pt_x, pt_y, visible, confidence]
                    results[keyname].setdefault(ident, {})
                    output = dict({'obj': num_objs+j, 'bbox': bbox, 'pose': pose, 'landmarks': landmarks})
                    results[keyname][ident][key] = output
            num_objs += num_annotations
    ifs.close()
    return results


def align_predictions(anno_mats, pred_mats, images_filter=None, tol=0.0001, max_iter=100000):
    def _compute_displacement(mean_matrix, matrices):
        return np.concatenate([cv2.Rodrigues(r)[0].T for r in mean_matrix.T @ matrices])

    def _compute_mean_rotation(mats):
        # Exclude samples outside the sphere of radius pi/2 for convergence
        distances = _compute_displacement(np.eye(3), mats)
        distances = np.linalg.norm(distances, axis=1)
        matrices = mats[distances < np.pi/2]

        mean_matrix = matrices[0]
        for _ in range(max_iter):
            displacement = _compute_displacement(mean_matrix, matrices)
            displacement = np.mean(displacement, axis=0)
            d_norm = np.linalg.norm(displacement)
            if d_norm < tol:
                break
            mean_matrix = mean_matrix @ cv2.Rodrigues(displacement)[0]
        return mean_matrix

    images_filter = range(0, len(anno_mats)) if not images_filter else images_filter
    deltas = np.matmul(pred_mats[images_filter], anno_mats[images_filter].transpose(0, 2, 1))
    mean_delta = _compute_mean_rotation(deltas)
    pred_mats[images_filter] = np.matmul(mean_delta.T, pred_mats[images_filter])
    return pred_mats


def print_headpose_metrics(err_images, anno_mats, pred_mats, images_filter=None):
    images_filter = range(0, len(err_images)) if not images_filter else images_filter
    err_images_filter = np.array([val for key, val in enumerate(err_images) if key in images_filter])
    anno_mats_filter = np.array([val for key, val in enumerate(anno_mats) if key in images_filter])
    pred_mats_filter = np.array([val for key, val in enumerate(pred_mats) if key in images_filter])
    # Mean absolute error
    mae_by_angle = np.mean(err_images_filter, axis=0)
    print('MAE: ' + str(np.mean(mae_by_angle)))
    print('[yaw, pitch roll]: ' + str(mae_by_angle))
    # Geodesic error, i.e. On the continuity of rotation representations in neural networks (CVPR 2019)
    cos = np.clip((np.trace(np.matmul(anno_mats_filter, pred_mats_filter.transpose((0, 2, 1))), axis1=1, axis2=2)-1)*0.5, -1, 1)
    ge = np.mean(np.rad2deg(np.arccos(cos)))
    print('GE: ' + str(ge))


def get_normalization(measure, annotation, database):
    import itertools
    if Measures(measure) is Measures.PUPILS:
        # Pupil distance normalization
        datasets = [subclass().get_names() for subclass in Database.__subclasses__()]
        idx = [datasets.index(subset) for subset in datasets if database in subset]
        parts = Database.__subclasses__()[idx[0]]().get_landmarks()
        pupil_left = np.mean([np.array(annotation['landmarks'][idx][:2]) for idx in [7, 8, 9, 10] if idx in list(itertools.chain.from_iterable(parts.values()))], axis=0)
        pupil_right = np.mean([np.array(annotation['landmarks'][idx][:2]) for idx in [11, 12, 13, 14] if idx in list(itertools.chain.from_iterable(parts.values()))], axis=0)
        normalization = cv2.norm(pupil_left-pupil_right)
    elif Measures(measure) is Measures.CORNERS:
        # Outer corners of the eyes normalization
        pupil_left = np.array(annotation['landmarks'][7][:2])
        pupil_right = np.array(annotation['landmarks'][12][:2])
        normalization = cv2.norm(pupil_left-pupil_right)
    elif Measures(measure) is Measures.HEIGHT:
        # Bounding box height normalization
        normalization = annotation['bbox'][3]-annotation['bbox'][1]
    elif Measures(measure) is Measures.SRAREA:
        # Square root of the bounding box area
        width, height = annotation['bbox'][2]-annotation['bbox'][0], annotation['bbox'][3]-annotation['bbox'][1]
        normalization = np.sqrt(width*height)
    elif Measures(measure) is Measures.DIAGONAL:
        # Diagonal of the bounding box
        width, height = annotation['bbox'][2]-annotation['bbox'][0], annotation['bbox'][3]-annotation['bbox'][1]
        normalization = np.sqrt((width*width)+(height*height))
    else:
        raise ValueError('Undefined normalization measure')
    return normalization


def metric_by_image(err_images, metric, percentile_threshold=98):
    return np.array([np.mean(val, axis=0) if metric == 'mean' else np.percentile(val, percentile_threshold, axis=0) for val in err_images.values()])


def area_under_curve(base, cumulative, auc_threshold):
    from scipy.integrate import simpson
    base = [x for x in base if (x < auc_threshold)]
    if not base:
        return 0.0
    cumulative = cumulative[0:len(base)]
    return (simpson(cumulative[0:10000], x=base[0:10000]) / auc_threshold) * 100.0


def failure_rate(base, cumulative, auc_threshold):
    base = [x for x in base if (x < auc_threshold)]
    if not base:
        return 100.0
    cumulative = cumulative[0:len(base)]
    return (1 - cumulative[-1]) * 100.0


def print_landmarks_metrics(err_images, auc_threshold, images_filter=None):
    images_filter = range(0, len(err_images)) if not images_filter else images_filter
    err_images_filtered = {key: val for key, val in err_images.items() if key in images_filter}
    mean_by_image = metric_by_image(err_images_filtered, 'mean')
    print('NME: ' + str(np.mean(mean_by_image, axis=0)))
    num_imgs, base = np.histogram(mean_by_image, bins=10000)
    cumulative = [x / float(len(mean_by_image)) for x in np.cumsum(num_imgs)]
    print('AUC: ' + str(area_under_curve(base, cumulative, auc_threshold)))
    print('FR: ' + str(failure_rate(base, cumulative, auc_threshold)))

def calculate_geodesic_error(anno_matrix, pred_matrix):
    # Asegúrate de que las matrices de entrada sean 3x3
    if anno_matrix.shape != (3, 3) or pred_matrix.shape != (3, 3):
        raise ValueError("(3, 3).")

    # Calcula el producto de la transpuesta de la anotación con la predicción.
    # Esto es equivalente a 'anno_matrix.T @ pred_matrix'
    product_matrix = np.matmul(anno_matrix.T, pred_matrix)
    
    # Calcula la traza del producto, que es '2 * cos(theta) + 1'
    trace_value = np.trace(product_matrix)

    # Aplica el clip para evitar errores de punto flotante.
    # La fórmula es (trace - 1) / 2.
    cos_value = np.clip((trace_value - 1) * 0.5, -1, 1)

    # Calcula el ángulo en radianes y lo convierte a grados.
    ge_degrees = np.rad2deg(np.arccos(cos_value))

    return ge_degrees

import matplotlib.pyplot as plt
def plot_geodesic_error_histogram(
    geodesic_errors,
    save_path='histograma_geodesico.png',
    title='Distribución de los Errores Geodésicos',
    xlabel='Error Geodésico (grados)',
    ylabel='Frecuencia',
    bins=Non
):
    if not isinstance(geodesic_errors, np.ndarray):
        raise TypeError("El input 'geodesic_errors' debe ser un array de NumPy.")
    
    if geodesic_errors.size == 0:
        print("Array vacío.")
        return
    
    if bins is None:
        bins = 'auto'
        
    plt.figure(figsize=(12, 7))
    
    plt.hist(geodesic_errors, bins=bins, edgecolor='black', alpha=0.8)
    
    mean_error = np.mean(geodesic_errors)
    median_error = np.median(geodesic_errors)
    
    plt.axvline(mean_error, color='red', linestyle='dashed', linewidth=2, 
                label=f'Media: {mean_error:.2f}°')
    
    plt.axvline(median_error, color='green', linestyle='dashed', linewidth=2, 
                label=f'Mediana: {median_error:.2f}°')
    
    plt.title(title, fontsize=16)
    plt.xlabel(xlabel, fontsize=12)
    plt.ylabel(ylabel, fontsize=12)
    plt.grid(axis='y', linestyle='--', alpha=0.7)
    plt.legend()
    plt.tight_layout() 
    
    plt.savefig(save_path)
    plt.close()
    
    print(f"Histograma guardado exitosamente en '{save_path}'")

